        public static string GetLocalIp()
        {
            string ips = "";
            string hostname = Dns.GetHostName();//得到本机名   
                                                //IPHostEntry localhost = Dns.GetHostByName(hostname);//方法已过期，只得到IPv4的地址   
            IPHostEntry localhost = Dns.GetHostEntry(hostname);

            foreach (IPAddress ip in localhost.AddressList)
            {
                if (!ip.IsIPv6LinkLocal && ip.ToString().Length < 16 && ip.ToString().Length >7)
                    ips += ip.ToString() + "\r\n";
            }

            return ips;
        }
        public static void GetYearAndWeekOfYear(ref int Year, ref int Month, ref int Day, ref int WeekOfYear)
        {
            DateTime now = DateTime.Now;
            GetYearAndWeekOfYear(ref Year, ref Month, ref Day, ref WeekOfYear, now);
        }
        public static void GetYearAndWeekOfYear(ref int Year, ref int Month, ref int Day, ref int WeekOfYear, DateTime now)
        {
            if (now.Ticks == 621356256000000000)
            {
                now = DateTime.Now;
            }
            System.Globalization.CultureInfo myCI = new System.Globalization.CultureInfo("zh-CN");
            WeekOfYear = myCI.Calendar.GetWeekOfYear(now,
                 System.Globalization.CalendarWeekRule.FirstDay,
                 System.DayOfWeek.Sunday);
            Year = now.Year;
            Month = now.Month;
            Day = now.Day;
        }
        public static void OpenIE(string url)
        {

            //从注册表中读取默认浏览器可执行文件路径  
            try
            {
                RegistryKey key = Registry.ClassesRoot.OpenSubKey(@"http\shell\open\command\");
                string s = key.GetValue("").ToString();

                System.Diagnostics.Process.Start(s.Substring(0, s.Length - 8), url);
            }
            catch
            {
                System.Diagnostics.Process.Start("iexplore.exe", url);
            }


        }
        public static DataSet GetDataSetByXml(string xmlData)
        {
            try
            {
                DataSet ds = new DataSet();

                using (StringReader xmlSR = new StringReader(xmlData))
                {

                    ds.ReadXml(xmlSR, XmlReadMode.InferTypedSchema); //忽视任何内联架构，从数据推断出强类型架构并加载数据。如果无法推断，则解释成字符串数据
                    if (ds.Tables.Count > 0)
                    {
                        return ds;
                    }
                }
                return null;
            }
            catch (Exception)
            {
                return null;
            }
        }


